Microsoft PowerPivot for Excel 2010: Give Your Data Meaning

Transform your skills, data, and business with the power users guide to PowerPivot for Excel. Led by two business intelligence (BI) experts, you'll learn how to create and share your own BI solutions using software you already know and love: Microsoft Excel. Discover how to extend your existing skills, using the PowerPivot add-in to quickly turn mass quantities of data into meaningful information and on-the-job results no programming required. The book introduces you to PowerPivot functionality, then takes a pragmatic approach to understanding and working with data models, data loading, data manipulation with Data Analysis Expressions (DAX), simple-to-sophisticated calculations, what-if analysis, and PowerPivot patterns. 

